import React,{Component} from "react"

class Header extends Component{
  constructor(){
    super()
    this.state
  }

  render(){
   return <div>
    <img src={this.props.img} />
    <h1> {this.props.name} </h1>
    <h4> {this.props.age} </h4>
    <p> {this.props.disc} </p>
   </div>
  }
}

export default Header
